import React, { useEffect, useState } from "react";
import axiosInstance from "../baseurl";

function ViewAllGyms() {
  const [gymdata, setdata] = useState([
    { name: "Gym1", email: "testmail1", empid: 1, gender: "male" },
    { name: "Gym2", email: "testmail2", empid: 2, gender: "female" },
  ]);

  useEffect(() => {
    axiosInstance
      .post(`/viewGyms`)
      .then((res) => {
        console.log(res, "Gym");
        if (res.data.msg == "No Data obtained ") {
          setdata([]);
        } else {
          setdata(res.data.data);
        }
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  const bookGym = (id)=>{
    console.log(id);
    console.log(localStorage.getItem(`CustomerLogId`));
    axiosInstance.post(`/bookGym`, {
      cid:localStorage.getItem(`CustomerLogId`),
      gymid:id,
      message:prompt('Send a message')
    })
    .then((res)=>{console.log(res);})
    .catch((err)=>{console.log(err);})
  }

  return (
    <div style={{minHeight:"400px"}}>
      <div class="accordion" id="accordionExample">
        <div class="accordion-item">
          <h2 class="accordion-header">
            <button
              class="accordion-button"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#collapseOne"
              aria-expanded="true"
              aria-controls="collapseOne"
            >
             View all Gym
            </button>
          </h2>
          <div
            id="collapseOne"
            class="accordion-collapse collapse show"
            data-bs-parent="#accordionExample"
          >
            <div class="accordion-body">
              <div className="container">
                <div class="container text-center">
                  <div class="row">
                    {/* trainerdata details mapped */}
                    {gymdata.length ? (
                      gymdata.map((a) => {
                        return (
                          <div className="col-6">
                            <div class="card card-body">
                              <div className="main">
                                <div class="card" >
                                  <div class="card-body">
                                    <h5 class="card-title">{a.name}</h5>
                                    <p class="card-text">Email : {a.email}</p>
                                    <p class="card-text">Contact : {a.contact}</p>
                                    <button className="btn btn-primary" onClick={()=>{bookGym(a._id)}}> Book now</button>
                                  </div>
                                </div>
                              </div>
                            </div>
                          </div>
                        );
                      })
                    ) : (
                      <div class="card card-body">
                        <div className="main">
                          <div class="card" style={{ width: "18rem;" }}>
                            <div class="card-body">
                              <h5 class="card-title">No data</h5>
                            </div>
                          </div>
                        </div>
                      </div>
                    )}
                  </div>
                </div>
              </div>{" "}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ViewAllGyms;
